        [Proofpoint]
        public IActionResult Swan(string apiname)
        {

            log.info(" apiname Setting is :  " + apiname);

            if (String.IsNullOrEmpty(apiname))
            {
                return View("~/Views/web001/Setting/Index.cshtml");
            }
            else
