                ViewBag.fetchdata = "fetch_data";
                ViewBag.method = "action";
                ViewBag.warningmessage = @service.Models.Language.login_language("200", @service.Models.Language.default_lang());

                ViewBag.api = apiname;
                ViewBag.token = value;

                return View("~/Views/web001/CRUD/SWAN.cshtml");
            }

        }

